hojas de las plantas juveniles imparipinnadas, hasta de unos 30 cm de largo incluyendo un peciolo de 7 cm de largo, foliolos 3 a 17, ovado-lanceolados a elíptico-lanceolados, de 3 a 15 cm de largo, ápice agudo a acuminado, base asimétrica, margen toscamente serrado, a veces parcial o totalmente entero, hojas de las plantas maduras simples    ||    En los adultos las hojas son simples, de 5 a 12 cm de largo y de 4 a 10 cm de ancho, ovadas, con ápice acuminado, bordes enteros o dentados y base desigual o redondeada. Pecíolos de 3 a 5 cm de largo y pulvinados en la base. 
de muy variadas formas, desde lanceoladas o elípticas hasta orbiculares y aun más anchas que largas, de hasta 14 cm de largo y 11 cm de ancho, ápice obtuso a acuminado, o bien, redondeado o retuso, base cuneada a redondeada, margen
entero a irregularmente serrado o dentado, de consistencia coriácea, glabras o pubescentes y después glabradas;
